import "./feature.scss"

export default function Feature() {
  return (
    <div className="featured">
       <img src={require("../../assets/images-backg.jpg")} alt="" width="100%" />

     <div className="info">
         <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.pngegg.com%2Fen%2Fsearch%3Fq%3Dbollywood&psig=AOvVaw02daAguiJkxyD655aZQriN&ust=1654343395091000&source=images&cd=vfe&ved=0CAwQjRxqFwoTCLCSzMebkfgCFQAAAAAdAAAAABAD" alt="" />
     </div>



    </div>

   
  );
}
